import { useContext } from "react";
import Global from "../context/Global";
import { Container } from "react-bootstrap";
import FormCreatePost from "../components/Forms/FormCreatePost/FormCreatePost";
import Filter from "../components/Filter/Filter";
import List from "../components/List/List";
import Post from "../components/Post/Post";

const MyPosts = () => {
  const { localStore } = useContext(Global);

  return (
    <Container>
      <FormCreatePost />
      <hr />
      <Filter />
      <h3 className="mt-5 mb-4">My posts: </h3>
      <List items={localStore.myPosts} renderItem={MyPost => {return <Post authorLogin={MyPost.authorLogin} key={MyPost.postId} postTitle={MyPost.postTitle} postBody={MyPost.postBody}/>}}/>
    </Container>
  );
};

export default MyPosts;
